import Banner from "../../components/player/Banner";
// import Calenderkk from "../../components/player/Calender";
export default function Schedule(){

    const [value,setValue] = useState('')

    console.log(value)

    if(vlaue === good){
        return <h1>good</h1>
    }

    return (
        <>
            <Banner onBannerTab={'선수단 일정'} aniWidth={'100%'}/>
            <section className="size1442">
                {/* <Calenderkk /> */}
            <form>
                <textarea value={value} onChange={ (e) => setValue(e.target.value)} name="" id=""></textarea>
            </form>

            </section>
        </>
    )
}
